from fastapi import FastAPI, Path
from fastapi.responses import HTMLResponse
import sqlite3
import json

app = FastAPI()

def get_db():
    return sqlite3.connect("database.db")

def init_db():
    db = get_db()
    cur = db.cursor()
   
    
    cur.execute("""
        CREATE TABLE IF NOT EXISTS settings (
            username TEXT PRIMARY KEY,
            config TEXT
        )
    """)
   
    db.commit()
    db.close()

init_db()


